  svg.append("g")
      .attr("class", "x axis")
      .attr("transform", "translate(0," + height + ")")
      .call(xAxis)

  svg.append("g")
      .attr("class", "y axis")
      .call(yAxis)

  var tooltip = d3.select("body").append("div")
    .attr("class", "tooltip")
    .style("opacity", 0);

  //svg.append("path")
  //    .data([dataset])
  //    .attr("class", "line")
  //    .attr("d", line);

  svg.selectAll(".dot")
      .data(dataset)
    .enter().append("circle")
      //.attr("class", "dot")
      .attr("r", 3.5)
      .attr("cx", function(d) { return xScale(d[" ideology"]); })
      .attr("cy", function(d) { return yScale(d[" leadership"]); })
      .style("fill", function(d) { return colors[d[" party"]];})
      .on("mouseover", function(d) {
          tooltip.transition()
               .duration(200)
               .style("opacity", .9);
          tooltip.html(d[" name"] )
               .style("left", (d3.event.pageX + 5) + "px")
               .style("top", (d3.event.pageY - 28) + "px");
      })
      .on("mouseout", function(d) {
          tooltip.transition()
               .duration(500)
               .style("opacity", 0);
      });

